import './App.scss';
import Header from '../src/components/Header/Header.jsx'
import { useState } from 'react';
function App() {
  const [list, setList] = useState([
    {
      id: 1,
      name: "A"
    },
    {
      id: 2,
      name: "B"
    },
    {
      id: 3,
      name: "C"
    },
    {
      id: 4,
      name: "D"
    },
  ])
  return (
    <div className="App">
      <ul>
        {
          list.map((elemnt, index) => (
            <li key={elemnt.id}>
              {index} - {elemnt.name}
            </li>
          ))
        }

      </ul>
      <Header />
    </div>
  );
}

export default App;
